import React from 'react'

export const TodoElement = ({todo, removeFromList}) => {

  const removeElem = (e) =>{
    removeFromList(e.target.value.id);
  }
  return (
    <div>
        <input type ={'checkbox'}/>
        <h1>{todo.title}</h1>
        <input onClick={() => removeElem()} type={'button'} value ={'Remove'}></input>
    </div>
  )
}
